def measure_time(start, remain):
    t = 0
    t = start[1] + start[0]
    for r in remain:
        if t < r[1]:
            t = r[1]
        elif (t - r[1]) % r[2] != 0:
            t += r[2] - (t - r[1]) % r[2]
        t += r[0]
    print(t)


